import Datas from '../data/data';


export default function Slider() {

    return (
        <main className='home-gallery'>
            {Datas.map(data => {
                return (
                    <DIV
                        key={data.id}
                        id={data.id}
                        title={data.title}
                        cover={data.cover}
                        style={{
                            backgroundImage: `url(${data.cover})`,
                            backgroundSize: 'cover',
                            backgroundPosition: 'center'
                        }}
                    />
                )
            })}
        </main>
    )
}
